- input: "TEXT\x1CC00171843\x1C7e771968-c26a-47fb-8\x1C\x1CF3X\x1CThe original report
    filed by the Liberty Mutual Insurance Company - PAC (the PAC) included a contribution
    dated July 6, 2007 payable to the Bennett Election Committee Inc., which contribution
    was designated for the 2010 primary election.  On July 29, 2007 a form was executed
    by Liberty Mutual redesignating the contribution to the 2010 general election.
    \ The PAC received a letter from the FEC dated March 19, 2008 which, among other
    things, noted that the PAC's contribution to the Bennett Committee caused the
    PAC to exceed the contribution limit for the 2010 primary.  Not realizing that
    the contribution had been redesignated, a letter was sent to the Bennett Committee
    on behalf of the PAC requesting a refund of the July contribution and the PAC
    filed with the FEC a Form 99 notifying the FEC that a refund had been requested.
    \ Since the redesignation was made in a timely manner, the PAC is not required
    to, and will not seek a refund of the contribution from the Bennett Committee. "
